import React from 'react';

import { Container, Row, Col } from 'react-bootstrap'
import CurrentWeather from './components/CurrentWeather';
import FiveDayForecast from './components/FiveDayForecast';
import './App.css';

const APPID = '8c3e7fd0f6ec033c8ecf4379bb4cce9d';

class App extends React.Component {
  componentDidMount() {
    fetch('api.openweathermap.org/data/2.5/weather?q=Atlanta')
      .then(res => console.log(res))

  }

  render() {
    return (
      <div className="App">
        <Container>
          <Row>
            {this.APPID}
            <Col sm={4}><CurrentWeather /></Col>
            <Col sm={8}><FiveDayForecast /></Col>
          </Row>
        </Container>
      </div>
    );
  }
}

export default App;
